import React, { Component } from 'react';

class navbar extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navBar">
                   <div className="d-flex col">
                       <div className="mr-2"><i className="fa fa-home rounded" aria-hidden="true"></i></div>
                       <input className="searchInp rounded" type="search" placeholder="Search..."/>
                       <h4 className="trello offset-md-4"><i className="fa fa-trello mr-1" aria-hidden="true"></i>Trello</h4>
                       <button className="button rounded ml-auto"><i className="fa fa-plus" aria-hidden="true"></i> Create New Board</button>
                   </div>
                </nav>
            </div>
        );
    }
}

export default navbar;
